function draw() {
  const cells = document.querySelectorAll('.cells');
  cells.forEach((cell) => {
    const currentCell = cell;
    currentCell.addEventListener('mouseover', () => {
      currentCell.style.backgroundColor = 'black';
    });
  });
}

function eraser() {
  const cells = document.querySelectorAll('.cells');
  cells.forEach((cell) => {
    const currentCell = cell;
    currentCell.addEventListener('mouseover', () => {
      currentCell.style.backgroundColor = 'white';
    });
  });
}

